import React, { useState } from 'react';

const Register = () => {
  const [user, setUser] = useState({
    name: '',
    email: '',
    password: '',
    password2: ''
  });

  const { name, email, password, password2 } = user;

  return (
    <form className='container' onSubmit={onSubmit}>
      <div className='form-row'>
        <div className='form-group col-md-4'>
          <label></label>
          <input
            type='text'
            className='form-control'
            name='name'
            placeholder='Name'
            value={name}
            onChange={onChange}
          ></input>
        </div>
        <div className='form-group col-md-6'>
          <label></label>
          <input
            type='email'
            className='form-control'
            name='email'
            placeholder='Email'
            value={email}
            onChange={onChange}
          ></input>
        </div>
        <div className='form-group col-md-6'>
          <label></label>
          <input
            type='password'
            className='form-control'
            name='password'
            placeholder='Password'
            value={password}
            onChange={onChange}
          ></input>
        </div>
      </div>
      <div className='form-row'>
        <div className='form-group col-md-6'>
          <label></label>
          <input
            type='password'
            className='form-control'
            name='password2'
            placeholder='Confirm Password'
            value={password2}
            onChange={onChange}
          ></input>
        </div>
      </div>
      <button type='submit' className='btn btn-primary'>
        Register
      </button>
    </form>
  );
};

export default Register;
